        <!-- Content inside the background can be added here if needed -->
        <p id="error-message" class="text-red-400 bg-gray-900 bg-opacity-75 p-4 rounded-lg hidden"></p>
    </div>

    <script type="module">
        const loadingContainer = document.getElementById('loading-container');
        const imageDisplaySection = document.getElementById('image-display-section');
        const errorMessage = document.getElementById('error-message');

        async function generateAndDisplayImage() {
            // Prompt from the previous successful generation
            const prompt = "A low-angle, dramatic shot of a colossal autonomous mining haul truck. The scene is set at dusk with a deep blue and purple sky. The truck's massive tires and structure are highlighted by integrated blue LED strips, giving it a high-tech, powerful presence in the vast, open-pit mine.";
            const apiKey = ""; // API key is handled by the environment

            const apiUrl = `https://generativelanguage.googleapis.com/v1beta/models/imagen-3.0-generate-002:predict?key=${apiKey}`;
            const payload = {
                instances: [{ prompt: prompt }],
                parameters: { "sampleCount": 1 }
            };

            try {
                const response = await fetch(apiUrl, {
                    method: 'POST',
                    headers: { 'Content-Type': 'application/json' },
                    body: JSON.stringify(payload)
                });

                if (!response.ok) {
                    throw new Error(`HTTP error! status: ${response.status}`);
                }

                const result = await response.json();

                if (result.predictions && result.predictions.length > 0 && result.predictions[0].bytesBase64Encoded) {
                    const imageUrl = `data:image/png;base64,${result.predictions[0].bytesBase64Encoded}`;
                    
                    // Set the generated image as the background of the section
                    imageDisplaySection.style.backgroundImage = `url('${imageUrl}')`;

                    // Hide loader and show the image section
                    loadingContainer.classList.add('hidden');
                    imageDisplaySection.classList.remove('hidden');

                } else {
                    throw new Error("پاسخ نامعتبر از API دریافت شد.");
                }
            } catch (error) {
                console.error("خطا در تولید تصویر:", error);
                errorMessage.textContent = `متاسفانه مشکلی در ساخت تصویر پیش آمد: ${error.message}`;
                errorMessage.classList.remove('hidden');
                loadingContainer.classList.add('hidden');
                // Show the container to display the error message inside it
                imageDisplaySection.classList.remove('hidden'); 
            }
        }

        // Run the function
        generateAndDisplayImage();
    </script>
